import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import data from './Data/Superheroes.json'
import ListHero from './Components'
const App = () => {
    let handleClick = () => {
        alert('Hi');
    }

    return (
        <div className='product'>

            <ListHero />

            <div className="d1">
                <form>
                    <input type="text" placeholder="Имя героя..."/>
                    <button type="submit"></button>
                </form>
            </div>
            <div className='ctalog' onClick={handleClick}>
                {/*CatalogHero*/}
                {data.dc.map((item, index) =>
                    <div className='catalog1'>
                        <img src={item.image}></img>
                        <p>{item.name}</p>
                    </div>
                )}
            </div>
            <div>
                <div className='switch'>
                    <div className='img1'>
                        <a href='/swithmar'><img
                            src='https://i.pinimg.com/originals/5f/2e/8b/5f2e8bb9837ac966fe4346387082d346.png'></img></a>
                    </div>
                    <div className='img1'>
                        <a href='/swithdc'><img
                            src='http://pluspng.com/img-png/dc-comics-logo-png-dc-comics-logo-png-600.png'></img></a>

                    </div>
                </div>
            </div>
        </div>
    )
}


ReactDOM.render(
    <App/>,
    document.getElementById('root')
);
